import React, { Component } from 'react';
import {
    Segment, Container,Divider
}
    from 'semantic-ui-react';

import './index.css';


class Body extends Component {

    render() {
        return (
            <Segment className="footer-div">
                <Container className="footer-group"> </Container>
                <Divider vertical />
                <Container className="footer-group"> </Container>
                <Container className="footer-group"> </Container>
            </Segment>
        )
    }
}
export default Body;
